import { useState } from "react";
import axios from "axios";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";




const VendorRegister = (props) => {
    const [MangerName, setName] = useState("");
    const [CanteenName, setCanteen] = useState("");
    const [email, setEmail] = useState("");
    const [contact, setContact] = useState(" ");
    const [Opentimings, setOp] = useState(" ");
    const [Closetimings, setCC] = useState(" ");
    const [Address, setAD] = useState(" ");
    const [date, setDate] = useState(null);


    const onChangeUsername = (event) => {
        setName(event.target.value);
    };
    const onChangeCanteen = (event) => {
        setCanteen(event.target.value);
    };

    const onChangeEmail = (event) => {
        setEmail(event.target.value);
    };
    const onChangeContact = (event) => {
        setContact(event.target.value);
    };
    const onChangeOP = (event) => {
        setOp(event.target.value);
    };
    const onChangeCC = (event) => {
        setCC(event.target.value);
    };
    const onChangeAD = (event) => {
        setAD(event.target.value);
    };


    const resetInputs = () => {
        setName("");
        setCanteen("");
        setEmail("");
        setContact("");
        setOp("");
        setCC("");
        setAD("");
        setDate(null);
    };

    const onSubmit = (event) => {
        event.preventDefault();

        const NUser = {
           MangerName: MangerName,
           CanteenName:CanteenName,
           email:email,
           contact:contact,
           Opentimings: Opentimings,
           Closetimings: Closetimings,
           Address: Address,
           date: Date.now(),
        };

        axios
            .post("http://localhost:4000/user/vendorregister", NUser)
            .then((response) => {
                alert("Created\t" + response.data.name);
                console.log(response.data);
            });

        resetInputs();
    };

    return (
        <div>
            <Grid container align={"center"} spacing={2}>
                <Grid item xs={12}>
                    <TextField
                        label="Manger Name"
                        variant="outlined"
                        value={MangerName}
                        onChange={onChangeUsername}
                    />
                </Grid>
                <Grid item xs={12}>
                    <TextField
                        label="Canteen Name"
                        variant="outlined"
                        value={CanteenName}
                        onChange={onChangeCanteen}
                    />
                </Grid>
                <Grid item xs={12}>
                    <TextField
                        label="Email"
                        variant="outlined"
                        value={email}
                        onChange={onChangeEmail}
                    />
                </Grid>
                <Grid item xs={12}>
                    <TextField
                        label="Contact Number"
                        variant="outlined"
                        value={contact}
                        onChange={onChangeContact}
                    />
                </Grid>
                <Grid item xs={12}>
                    <TextField
                        label="Opening time"
                        variant="outlined"
                        value={Opentimings}
                        onChange={onChangeOP}
                    />
                </Grid>
                <Grid item xs={12}>
                    <TextField
                        label="Closing time"
                        variant="outlined"
                        value={Closetimings}
                        onChange={onChangeC}
                    />
                </Grid>
                <Grid item xs={12}>
                    <TextField
                        label="Address"
                        variant="outlined"
                        value={Address}
                        onChange={onChangeAD}
                    />
                </Grid>
                <Grid item xs={12}>
                    <Button variant="contained" onClick={onSubmit}>
                        Register
                    </Button>
                </Grid>
            </Grid>
        </div>
    );
};

export default VendorRegister;
